import styled from "styled-components";
import { Formik, Field, Form} from "formik"
import { TextField, Button } from "@material-ui/core";

const BoardWriteFormWrapper = styled.div`
  width:100%;
  height:100%;
  display:flex;
  flex-flow: row wrap;

`;

interface Props { 

}

const BoardWriteForm = ({  }:Props):JSX.Element=> {

  return (
    <BoardWriteFormWrapper> 

      <Formik initialValues={{ title: "" }} onSubmit={(data, { setSubmitting }) => {
        setSubmitting(true) 
        console.log(data)
        if (!data.title) {
          return alert("타이틀을 입력해주시오.");
        }
        setSubmitting(false)
      }}>

      { 
          ({ isSubmitting }) => (
          <Form> 
                <div>
                  <Field name="title" as={TextField} /> 
                </div>
                <Button type="submit" disabled={isSubmitting}>Submit</Button>
          </Form>
          ) 
        }

      </Formik>

    </BoardWriteFormWrapper>
  )

}

export default BoardWriteForm;
